// SPDX-License-Identifier: MIT

pragma solidity ^0.8.17;

contract Escrow {
    address payable public Buyer;
    address payable public Seller;
    address public arbiter;
    uint256 public amount;
    bool public buyerApproved;
    bool public sellerApproved;
    address public owner;

    constructor() {
        owner = msg.sender;
    }

    function initiaize(
        address payable _buyer,
        address payable _seller,
        address _arbiter
    ) public payable {
        require(owner == msg.sender, "only owner can initialize");
        require(_buyer != _seller && _buyer != _arbiter && _seller != _arbiter, "Buyer, seller and arbiter can not be identical");
        require(msg.value > 100 wei, "Insufficient balance");
        Buyer = _buyer;
        Seller = _seller;
        arbiter = _arbiter;
        amount = msg.value;
    }

    function approveByBuyer() public {
        require(msg.sender == Buyer, "Only buyer can approve");
        require(buyerApproved != true, "Buyer already approved");
        buyerApproved = true;
    }

    function approveBySeller() public {}

    function releaseToBuyer() public {}

    function releaseToSeller() public {}

    function dispute() public {}

    function getBalance() public view returns (uint256) {}

    function reset() public {}
}


